import 'bootstrap/dist/css/bootstrap.css';
import React,{Component} from 'react';
import './App.css';
import { Link } from 'react-router-dom';
import Navbar from './Navbar.js'
import Footer from './Footer.js'

export default class Contact extends Component{
    render(){
        return(
            <div>
                <Navbar></Navbar>
                <form action="mailto:contact@yourdomain.com" method="POST" enctype="multipart/form-data" name="EmailForm">
                    Name: <input type="text" size="19"name="ContactName"></input>
                    Message:<textarea name="ContactCommentt" rows="6" cols="20"></textarea>
                    <input type="submit" value="Submit"></input>
                </form>
                <Footer></Footer>
            </div>
        )
    }
}
